import React from 'react';
import MegaMenu from '../MegaMenu/';
import "./navbar.css";

const Navbar = () => {
    let vegetables={
        title:"Vegetables, Oil & Masala", 
        list:["Mens Wear", "Women's Wear", "Sports Wear", "Winter Wear", "Traditional Wears", "Brands"]
    }
    let fruits={
        title:"Fruits(പഴങ്ങൾ)",
        list:["Headphones", "Home Appliances", "Television", "Mobile Phones", "Memory Cards", "Camera", "Speakers", "Computers"]
    }
    let foodGrains={
        title:"Food Grains(ധാന്യങ്ങള്‍)",
        list:["Headphones", "Home Appliances", "Television", "Mobile Phones", "Memory Cards", "Camera", "Speakers", "Computers"]
    }
    let organic={
        title:"Organic(ജൈവകൃഷി)",
        list:["Headphones", "Home Appliances", "Television", "Mobile Phones", "Memory Cards", "Camera", "Speakers", "Computers"]
    }
    return(
        <div className="navbar">
            <ul className="menu">
                <MegaMenu category={vegetables} />
                <MegaMenu category={fruits} />
                <MegaMenu category={foodGrains} />
                <MegaMenu category={organic} />
            </ul>
        </div>
    )
}

export default Navbar;
